import React from 'react';
import NavbarLeft from './components//NavbarLeft';
import TransitionPage from './TransitionPage';
import { CardProvider, useCard } from './CardContext';

const MainContent = () => {
  const { selectedCard, isLottieVisible, finishAnimation, resetCard } = useCard();

  return (
    <div>
      <NavbarLeft />

      {!isLottieVisible && !selectedCard && (
        <div style={{ marginLeft: '200px' }}>
          {/* Vous pouvez ajouter d'autres composants ici */}
        </div>
      )}

      {isLottieVisible && (
        <TransitionPage
          selectedCard={selectedCard}
          onComplete={finishAnimation}
          onBack={resetCard}
        />
      )}
    </div>
  );
};

const MainComponent = () => (
  <CardProvider>
    <MainContent />
  </CardProvider>
);

export default MainComponent;
